export class TagIcon {
    constructor() {
        /** The size of the icon */
        this.size = 24;
    }
    render() {
        // const { accent } = this;
        // const cls = accent ? `tag-icon--${accent.toLowerCase()}` : `tag-icon--default`;
        // console.log('does this get hit??????', this.getSVG());
        // return <div class={cls}>{this.getSVG()}</div>;
        return h("tag-icon-svg", { icon: this.icon, size: this.size, accent: this.accent });
    }
    static get is() { return "tag-icon"; }
    static get encapsulation() { return "shadow"; }
    static get properties() { return {
        "accent": {
            "type": String,
            "attr": "accent"
        },
        "icon": {
            "type": String,
            "attr": "icon"
        },
        "size": {
            "type": Number,
            "attr": "size"
        }
    }; }
    static get style() { return "/**style-placeholder:tag-icon:**/"; }
}
